import RecipeView from "../../components/RecipeView";

const recipe = {
    name: "V60",
    description: "test",
    steps: [
        {
            description: "Wet the grounds",
            duration: 5,
        },
        {
            description: "Bloom",
            duration: 45,
        },
        {
            description: "Pour in 60% of water",
            duration: 30,
        },
        {
            description: "Pour in remainder of water",
            duration: 30,
        },
        {
            description: "Stir once clockwise and once counterclockwise",
            duration: 5,
        },
        {
            description: "Swirl once clockwise and once counterclockwise",
            duration: 10,
        },
    ],
};

const V60Recipe = () => <RecipeView recipe={recipe} />;

export default V60Recipe;
